import React, {useState} from "react";


const Artist = ()=>{
    const [result, setResult] = useState('');
    const [search, setSearch] = useState('');
    
    const options = {
        method: 'GET',
        headers: {
            'X-RapidAPI-Key': 'f1d641037bmsh805777c136ad783p142fecjsn73217d65f347',
            'X-RapidAPI-Host': 'genius.p.rapidapi.com'
        }
    };
    
   
    const handleclick =  async ()=>{
        fetch(`https://genius.p.rapidapi.com/${search}/16775`, options)
        .then(response => response.json())
        .then(response => console.log(response))
        .catch(err => console.error(err));
            
        

    }

    const searchFunc =(event)=>{
        setSearch(event.target.value)
    }



    
    return(
        <div>
            
            <div className="box">
                <div>
                    <input value="search" onChange={searchFunc}></input>
                </div>
                <button className="btn" onClick={handleclick}>Button</button>
                
                
                {result}


            </div>
            
        </div>
            
    )
    
   
}

export default Artist;
